import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles(() => ({
	root: {
		height: "100%",
		width: "98%",
		display: "flex",
		flexDirection: "row",
		justifyContent: "center",
		alignItems: "center",
		float: "right",
		backgroundColor: "rgba(0,0,0,0)",
	},
	calendar: {
		border: "none",
	},
	calendarGridItem: {
		height: "50%",
		backgroundColor: "#fff",
		display: "flex",
		flexDirection: "column",
		alignItems: "center",
		justifyContent: "center",
		margin: "10px",
	},
	doughtnutGridItem: {
		height: "50%",
		backgroundColor: "#fff",
		display: "flex",
		flexDirection: "column",
		alignItems: "center",
		justifyContent: "center",
		margin: "10px",
	},
	barChartGridItem: {
		height: "100%",
		backgroundColor: "#fff",
		display: "flex",
		flexDirection: "column",
		alignItems: "center",
		justifyContent: "center",
		margin: "10px",
	},
	buttonGroup: {
		width: "100%",
	},
	button: {
		width: "33%",
	},
	barChart: {
		width: "100%",
	},
}));
